const _hoisted_6 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Archer</li><li>True Name: Emiya</li><li>Gender: Male</li><li>Source: Fate/Stay Night</li><li>Region: Japan</li><li>Alignment: Chaotic Evil</li><li>Height: 187 cm</li><li>Weight: 78 kg</li></ul><p><strong>Meta</strong></p><ul><li>Character Creator: Nasu Kinoko, Higashide Yuuichirou</li><li>Character Illustrator: Sasaki Shounen</li><li>Character Voice: Suwabe Junichi</li><li>Appearance in Main Works: Fate/Grand Order</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">E</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">?</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Magic Resistance: D</strong></p><p>Invalidates single action magic usage.</p><p><strong>Independent Action: A</strong></p><p>The ability to be able to act independently for a period even if magic energy supply from the Master is severed.</p><p>In cases where vast quantity of magic energy is needed, such as during usage of Noble Phantasm, backup from the Master is necessary.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Bulletproof Treatment: A</strong></p><p>A Skill that may very well be called \u201CProtection from Arrows\u201D by means of the most modern [1] Heroic Spirit.</p><p>It\u2019s designated as bulletproof, but strictly speaking most projectiles can be repelled.</p><p><strong>Projection Magic: C (conditionally A+)</strong></p><p>A magic that reproduces tools by his image for but several minutes.</p><p>The pair of swords that Archer favored, Kanshou and Bakuya, was something created by means of projection magic as well.</p><p>Its rank rapidly increases only when the projection subject is categorized as \u201Csword\u201D.</p><p>Through the special trait of \u201Cable to prepare counterfeits many times over\u201D, Emiya momentarily increases the power of the projected Noble Phantasms by making them crash and detonates.</p><p><strong>Derisive Mind of Steel: A</strong></p><p>A Mental Pollution Skill granted upon being inverted.</p><p>Unlike Mental Pollution, it is able to force in the designated concept; close to a kind of brainwashing.</p><p>The thought bestowed to him makes the protection of Human Order the priority; deeming the way of Guardians which forsakes everything other than that to be acceptable.</p><p>Were this man not endowed with A-rank, he would not have been able to sufficiently exhibits the power of his inversion status.</p><h1 id="tl-s-note" tabindex="-1"><a class="header-anchor" href="#tl-s-note" aria-hidden="true">#</a> TL&#39;s Note</h1><p>[1] \u6700\u65B0: newest, latest; i opted with most modern because using newest or latest makes me imagine iPhone release instead</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="unlimited-lost-works-infinite-swords-creation" tabindex="-1"><a class="header-anchor" href="#unlimited-lost-works-infinite-swords-creation" aria-hidden="true">#</a> Unlimited Lost Works: Infinite Swords Creation</h1><ul><li>Rank: E~A</li><li>Type: Anti-Unit Noble Phantasm</li><li>Range: 30-60</li><li>Max. Targets: ? unit</li></ul><p>Unlimited Lost Works.</p><p>The \u201CInfinite Swords Creation\u201D is one of the furthest land that the magic specialized in forging swords had staked a life time to arrive at.</p><p>This reality marble accumulates within it all the weapons bearing the concept of \u201Cswords\u201D that he had seen.</p><p>...However, this man\u2019s \u201CInfinite Swords Creation\u201D arises from within the body of the opponent. The minuscule Reality Marble becomes a dreadful force within their body and rips the enemy apart.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><ul><li>First Person: Ore</li><li>Second Person: Anta</li><li>Third Person: Kare/kanojo/sore</li></ul><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>The ally of justice who had fallen to ruins.</p><p>At the beginning, he had been a sweeper who acts under a coldheaded theory and law. However, by means of several incidents, he transforms into a satirist to the point of self-injury.</p><p>He chooses mission that must be done composedly and heartlessly, and deals with it rationally.</p><p>Even now, his recollection and ego are whittling away bit by bit; due to that, his mundane memories are poor.</p><p>It seems that he puts to his diary only things that he judges to must be recorded.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>He holds absolutely no expectation towards the Master.</p><p>The man who speaks cynically of himself as a machine would gladly do anything, no matter how fiendish, if it\u2019s for the sake of achieving his objective.</p><p>And of course, should avoiding fiendish method and even with a roundabout way the objective gets done, he would not stop that either.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><ul><li><p>\u201CHere for revenge? Not bad. That\u2019s a befitting last days.\u201D</p></li><li><p>\u201C...Did you say something, Master? Apologies, lately I\u2019ve had some dizzy attacks\u2026. Even a conversation that happens just five minutes ago felt like a distant dream.\u201D</p></li><li><p>\u201CIt\u2019s time? Very well. Let\u2019s go, Master. I know. We\u2019re doing the usual; saving the weak and crushing the strong, no? Being an ally of justice isn\u2019t bad. -I don\u2019t know why. But for some reason I feel like weeping.\u201D</p></li><li><p>\u201CSo. The swan had thus flew away. Avarice brings only harm. Such a frame and body would be able to neither flutter nor float away. It shall sink like the metal it is.\u201D</p></li></ul><h2 id="historical-character-and-figure" tabindex="-1"><a class="header-anchor" href="#historical-character-and-figure" aria-hidden="true">#</a> Historical Character and Figure</h2><p>He is not the nameless that the society brought forth, but a ruined, mindless enforcer[1] who threw away his own name.</p><p>His memory is damaged, and he had already lost his past.</p><p>The man continues to deride himself, who had forsaken morality, despised love, and became nothing but a living corpse.</p><p>He has no ideals, no beliefs; and thus he is efficient.</p><p>Boasting of being just like a machine, a nameless antihero.</p><p>Due to parts of his roots being corrupted, he will unfold a slaughter without mercy if it\u2019s for the sake of accomplishing his objective.</p><h1 id="tl-s-note-1" tabindex="-1"><a class="header-anchor" href="#tl-s-note-1" aria-hidden="true">#</a> TL&#39;s Note</h1><p>[1] \u57F7\u884C\u8005. Can also mean executioner/performer. Literally the one who does stuffs.</p><h2 id="standard-weapons" tabindex="-1"><a class="header-anchor" href="#standard-weapons" aria-hidden="true">#</a> Standard Weapons</h2><p>He utilizes two guns; a two sword style by means of the pair of guns \u201CKanshou and Bakuya\u201D.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Emiya</strong></p><p>My past self, who put a bitter smile as if saying he can\u2019t put a complain even if killed.[1]</p><p><strong>Sesshouin Kiara</strong></p><p>I don\u2019t have much of an opinion in matters and affairs regarding this woman.</p><p>I will simply kill her, no matter how many times, if her way of being propagates through society and brings harm to it.</p><p><strong>Jaguar Man</strong></p><p>\u2026..You, and that boy\u2026. I\u2026..</p><h1 id="tl-s-note-2" tabindex="-1"><a class="header-anchor" href="#tl-s-note-2" aria-hidden="true">#</a> TL&#39;s Note</h1><p>[1] with how japanese works this is ambigue af. I cant say who is being killed in this sentence, emiya or emiya, although the answer is obviously emiya.</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>Emiya who is very much out of the usual\u2026 I\u2019ve drawn him in high spirit with who knows how many words that came out during the exchange with Type-MOON, strengthening the image of \u201CEmiya who upon further thinking looks like a prisoner!\u201D Afterwards, his voice, his meager setting development, as well as his story began to take form, becoming a character; his role nimbly jumps over my image of him, heading into an unthinkable, heartrending direction that left a deep impression. (Sasaki Shounen)</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-060.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-061.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-062.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-063.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-064.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-065.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-066.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-067.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-068.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-069.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-070.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-071.jpg?raw=true" alt=""></p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 89);
